INSERT INTO `platos` (`id`, `nombre`, `descripcion`, `preparacion`, `tiempo`, `cuantas_personas`, `imagen`) VALUES
(10, 'Pur de patata violeta con huevo mollet', 'Con elaboraciones culinarias tan sencillas como es un pur de patatas y un huevo cocido, se pueden hacer platos tan exquisitos como este Pur de patata violeta con huevo mollet, ajo negro y trufa. Toma nota de la receta, es fcil y rpida de hacer, y gustar a todos.', 'Lava bien las patatas porque se van a cocer con piel. Ponlas en un cazo cubiertas con agua y cucelas hasta que estn tiernas. Entonces, refrscalas en agua fra para poder pelarlas, pero sin que se enfren las patatas.\r\n\r\nPon en un cuenco amplio las patatas peladas y rmpelas con un tenedor. Aade leche (caliente) y agua a partes iguales, empieza poniendo un poco menos de la cantidad indicada, y ajusta la cantidad al gusto.\r\n\r\nPur de patata violeta con huevo mollet\r\nAade tambin la mantequilla cortada en daditos y condimenta con sal, nuez moscada, chile y pimienta de Sichuan poniendo cantidades al gusto, que quede muy poco picante. Chafa con el tenedor mezclando bien para obtener un pur de patata rstico, el clsico pur de forquilla (pur de tenedor).\r\n\r\nPara hacer los huevos mollet, pon un cazo con agua a calentar y cuando rompa a hervir incorpora los huevos, cuece durante cinco minutos justos y retralos del fuego, corta la coccin refrescando los huevos con agua fra y plalos cuidadosamente.\r\n\r\nEmplatado\r\n\r\nSirve en platos hondos el pur de patata violeta, coloca encima un huevo mollet y unas lminas de ajo negro. Condimenta con una pizca de chile y pimienta de Sichun recin molidos, slo para romper el color, y unas gotas de aceite de trufa. Lleva enseguida a la mesa y buen provecho!', 1, 4, );

